  useEffect(() => {
    fetch('http://127.0.0.1:5000/get', {
      headers: {
        'method':'GET',
        headers:{
          'Content-Type':'application/json'
        }

      }
    })
    .then(resp => resp.json())
    .then(resp => setPrescriptions(resp))
    .catch(error => console.log(error))

  },[])
  return (
    <div className="App">
        <h1>Hello</h1>

    </div>
  );
}

export default App;
